(538, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:69:\"Ask-Me-Anything Session with Elementor\'s VP Product  The Takeaways\";s:7:\"excerpt\";s:196:\"In case you missed it, here are the main takeaways from our AMA session. Our VP Product answered questions on topics ranging from performance, new features, ecommerce, whats up ahead, and more.\";s:7:\"created\";i:1633419048;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:150:\"https://elementor.com/blog/ask-me-anything-session-with-elementors-vp-product/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:42:\"UX vs. UI Design: Whats the Difference?\";s:7:\"excerpt\";s:203:\"Interested in becoming a web design specialist? In this article we\'ll look at UX vs UI design, examine the differences between the two disciplines and give some tips on how to choose the right specialty.\";s:7:\"created\";i:1632998984;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:108:\"https://elementor.com/blog/ux-vs-ui/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:44:\"Introducing Extended E-Commerce Capabilities\";s:7:\"excerpt\";s:245:\"Meet Elementors new expanded ecommerce capabilities  a complete set of improvements of the Menu Cart widget, Dynamic WooCommerce Tags, as well as other goodies such as AJAX load more for posts and Vimeo videos on the Video Playlist widget.\";s:7:\"created\";i:1630410208;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:129:\"https://elementor.com/blog/introducing-elementor-pro-3-4/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:55:\"What Is Material Design? Definition, Uses, and Examples\";s:7:\"excerpt\";s:147:\"Material Design is the standard for designing and creating websites and apps. Discover why and learn how to use it to make a user-friendly website.\";s:7:\"created\";i:1612263675;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:123:\"https://elementor.com/blog/what-is-material-design/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:53:\"Elementor SEO: How To Optimize Your Elementor Website\";s:7:\"excerpt\";s:154:\"SEO is crucial to the success of any website, but to many users, it still remains a mystery. Discover what SEO is and how to use it to optimize your site.\";s:7:\"created\";i:1611838485;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:113:\"https://elementor.com/blog/elementor-seo/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
