(67, 1, '2021-09-19 21:38:45', '2021-09-19 21:38:45', 'ruby is a pink to blood-red colored gemstone, a variety of the mineral corundum. Other varieties of gem-quality corundum are called sapphires. Ruby is one of the traditional cardinal gems, together with amethyst, sapphire, emerald, and diamond. The word ruby comes from ruber, Latin for red.<img class=\"alignnone size-medium wp-image-68\" src=\"http://chalaka/final%20project/wp-content/uploads/2021/09/polished-ruby-300x228.png\" alt=\"ruby image\" width=\"300\" height=\"228\" />', 'ruby', '', 'publish', 'open', 'closed', '', 'ruby', '', '', '2021-09-19 21:38:45', '2021-09-19 21:38:45', '', 0, 'http://chalaka/final%20project/?post_type=product&#038;p=67', 0, 'product', '', 0),
